import NavigationBar from './NavigationBar';
import PageContent from './PageContent';

export default class Dashboard extends React.Component{
    render(){
        return(
            <div>
                <div></div>
                <NavigationBar/>
                <PageContent/>
            </div>
        )
    }
}
